import myAxios from "./myAxios";
import { Buffer } from "buffer";


class UserService {
  getUsers() {
    return myAxios.get();
  }

  deleteUser(id) {
    myAxios.delete((usersURL + "/" + id));
  }

  postUser(name, position) {
    myAxios.post((usersURL + "?name=" + name + "&position=" + position));
  }
}

export default new UserService();
